import { Card, Flex, Typography, Button } from 'antd';
const { Meta } = Card;

function Calendar() {
    return (
        <div style={{ width: "80%" }}>
            <Card
                hoverable
                style={{ width: "400", margin: "20px" }}
                bodyStyle={{ padding: 0, overflow: 'hidden' }}
            >
                <Flex>
                    {/* <Flex justify="space-between"> */}
                    <img
                        alt="avatar"
                        src="http://picsum.photos/300/300"
                        style={{ display: 'block', width: 273 }}
                    />
                    <Flex
                        vertical
                        align="flex-end"
                        // justify="space-between"
                        style={{ padding: 32 }}>

                        <Typography.Title level={3}>
                            dfadfadsaafa
                            <p>dsfasfa | Grade: dfadfad</p>
                        </Typography.Title>
                    </Flex>
                </Flex>
            </Card>

            <Card
                hoverable
                style={{ width: "420" }}
                styles={{
                    body: {
                        padding: 0,
                        overflow: 'hidden',
                    },
                }}
            >
                <Flex justify="space-between">
                    <img
                        alt="avatar"
                        src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
                        style={{
                            display: 'block',
                            width: 273,
                        }}
                    />
                    <Flex
                        vertical
                        align="flex-end"
                        justify="space-between"
                        style={{
                            padding: 32,
                        }}
                    >
                        <Typography.Title level={3}>
                            “antd is an enterprise-class UI design language and React UI library.”
                        </Typography.Title>
                        <Button type="primary" href="https://ant.design" target="_blank">
                            Get Started
                        </Button>
                    </Flex>
                </Flex>
            </Card>

        </div>
    )
}

export default Calendar
